import { useEffect, useState } from "react";
import { fetchOdooVehicles } from "../api";

function OdooVehicles() {
  const [vehicles, setVehicles] = useState([]);
  const [error, setError] = useState("");

  useEffect(() => {
    fetchOdooVehicles()
      .then(setVehicles)
      .catch((err) => setError(err.message));
  }, []);

  if (error) return <p className="text-red-500">{error}</p>;
  if (!vehicles.length) return <p>Loading Odoo vehicles...</p>;

  return (
    <ul className="space-y-2 bg-white p-4 rounded-md shadow">
      {vehicles.map((v, i) => (
        <li key={i} className="border-b pb-2">
          <strong>{v.name}</strong> - {v.license_plate}
        </li>
      ))}
    </ul>
  );
}

export default OdooVehicles;
